import React, { Component } from 'react';
import logo from './logo.svg';
//import './App.css';
import './components/InsertPage'
import General from './components/General';
//import SearchPage from '.components/SearchPage';
import {Container} from 'react-bootstrap';
import { Button } from 'react-bootstrap';
import { ButtonToolbar } from 'react-bootstrap';
import Navbar from 'react-bootstrap/Navbar'
import { Form } from 'react-bootstrap';
import { FormControl } from 'react-bootstrap';
import { Nav } from 'react-bootstrap';
import { NavDropdown } from 'react-bootstrap';
class App extends Component {
   constructor(props){
     super(props)
     this.state = {
       currentPage : ''
     }

   }




  render() {

    return (

      <div className="App">
          <Container>
          <Navbar collapseOnSelect expand='lg' bg= 'dark' variant= 'green'>
         <Navbar.Brand expand = "lg" bg = "dark" >Report-Engine </Navbar.Brand>
          <Button variant="outline-primary" size = "lg" bg= "blue" >Insert A Report </Button>
          <Button variant="outline-primary"  size = "lg" bg = "blue" >See Search Options</Button>
        </Navbar>
          </Container>
      </div>
    );
  }
}

export default App;
